  .slider-box-container{
    background-color: #bdbdbd;
    padding: 20px 0 20px 0;
    overflow: hidden;
  }

  .slider-box {
    display: flex;
    justify-content: space-between;
    flex-direction: row;
    /* flex-wrap: wrap; */
    max-width: 1410px;
    width: 100%;
    margin: 0 auto;
    background:#000;
  }

  .swiper-container {
    width: 340px;
    /* height: 278px; */
    overflow: hidden;
  }
  .swiper-container:first-child {
    margin-left: 0;
  }
  .swiper-container:last-child {
    margin-right: 0;
  }
  .swiper-slide {
    width: auto;
    max-width: 340px;
  }

  .swiper-slide img{
    display: block;
    width: 100%;
    max-width: 340px;
  }

  p.top_text {
    width: 100%;
    text-align: center;
    color: white;
    font-weight: bold;
    font-size: 12px;
    position: absolute;
    top: 10px;
    left: 0;
    padding: 0 20px 0 20px;
  }

  .more_btn i {
    color: #ffba00;
    margin-left: 10px;
  }

  .fa {
    display: inline-block;
    font: normal normal normal 14px/1 FontAwesome;
    font-size: inherit;
    text-rendering: auto;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
  }
  .more_btn {
    display: block;
    width: 100%;
    background: black;
    color: white;
    height: 28px;
    position: relative;
    bottom: 0;
    left: 0;
    font-size: 12px;
    font-weight: bold;
    line-height: 28px;
    padding: 0 10px;
    text-align: right;
    -moz-text-decoration-color: white;
    text-decoration-color: white;
  }

  .more_btn a:hover{
    text-decoration: underline;
    color: white;
  }

  .more-text-mopar {
    position: absolute;
    color: #000;
    top: 40%;
    width: 190px;
    left: 24%;
    line-height: 1.3;
    font-size: 16px;
  }

  .more-text-mopar b {
    font-weight: bold;
  }

  @media only screen and (max-width: 1024px) {
    .more-text-mopar {
      top: 30%;
      font-size: 12px;
    }
  }

  @media only screen and (max-width: 767px) {
    .slider-box {
      flex-wrap: wrap;
    }
    .swiper-container:first-child {
      margin-left: auto;
    }
    .swiper-container:last-child {
      margin-right: auto;
    }

    .more-text-mopar{
      top: 40%;
      font-size: 16px;
    }
  }

